import React, { Component } from 'react';
import Barre_nav from "./components/barre_nav/Barre_nav";
import Home from './page/home/Home';




function App() {


  return (
    <div>
      <div className="container">
        <Barre_nav/>
        <div className="main">
          <Home/>

        </div>
      </div>
    </div>
  );
}

export default App;
